<template>
  <div class="content-wrap">
    <div class="content-area">
      {{ shareKey }}
      <div v-for="chart in sortedCharts" :key="chart.id">
        <div v-if="!chart.hidden">
          {{ chart.labelLeft }}
          {{ chart.name }}
          {{ chart.labelRight }}
          {{ chart.updated }}
          <a @click="hideChart(chart.id)">[隠す]</a>
          <div v-if="!chart.hidden">
            <img :src="chart.imageUrl">
          </div>
        </div>
      </div>
      <div>
        <a @click="showAllChart">[全て表示する]</a>
        (
        {{ charts.filter(c => c.hidden).length }} / {{ charts.length }}
        )
      </div>
    </div>
  </div>
</template>

<script>
export default {
  components: {
  },
  data: function () {
    return {
      shareKey: (p => p.has('key') ? p.get('key') : '')(new URLSearchParams(location.search)),
      charts: [1, 2, 3, 4, 5, 6].map(i => ({
        id: `${Math.random()}`,
        updated: new Date(Date.now() + (1 - Math.random() / 2) * 600000),
        imageUrl: 'data:image/webp;base64,',
        name: `${i}班`,
        labelLeft: '酸素',
        labelRight: '二酸化炭素',
        hidden: false,
      }))
    }
  },
  computed: {
    sortedCharts() {
      return [...this.charts].sort((a, b) => {
        if (a.hidden !== b.hidden) {
          return a.hidden ? -1 : 1
        }
        if (a.name !== b.name) {
          return a.name < b.name ? -1 : 1
        }
        return 0
      })
    }
  },
  methods: {
    sortCharts() {
      this.charts.sort((a, b) => {
        if (a.hidden !== b.hidden) {
          return b.hidden ? 1 : 0
        }
        if (a.name !== b.name) {
          return a.name < b.name ? -1 : 1
        }
        return 0
      })
    },
    hideChart(id) {
      // this.charts.find(c => c.id == id).hidden = true
      this.charts[this.charts.findIndex(c => c.id == id)].hidden = true
      this.sortCharts()
    },
    showChart(id) {
      this.charts[this.charts.findIndex(c => c.id == id)].hidden = false
      this.sortCharts()
    },
    showAllChart() {
      this.charts = this.charts.map(c => {
        c.hidden = false
        return c
      })
    },

  }
}
</script>
<style scoped>
.content-wrap {
  display: flex;
  justify-content: space-between;
}

.content-area {
  padding: 15px 5%;
  width: calc(100% - 220px);
  background: #f5f5f5;
}
</style>
